Afrah Sayed, Vidushi\nDirected by Nitya Mehra, Karan Kapadia, Kopal Naithani and Sudhanshu Saria.\nWritten by Sudhanshu Saria, Adwitiya Kareng Das, Sunayana Kumari and Radhika Malhotra.\nProduced by Ashi Dua Sara and Karan Kapadia\nCreated by Nitya Mehra.\n\nOfficial Release Date March 14, 2024 on Prime Video India.\n\nAbout Prime Video: Prime Video is a premium streaming service that offers Prime members a collection of award-winning Amazon Original series, thousands of movies \u0026 TV showsall with the ease of finding what they love to watch in one place. Prime Video is just one of the many benefits of a Prime membership, available for just 1499/ year. \nIncluded with Prime Video: Thousands of acclaimed TV shows \u0026 movies across languages \u0026 geographies, including Indian films such as Shershaah, Soorarai Pottru, Sardar Udham, Gehraiyaan, Jai Bhim, Jalsa, Shakuntala Devi, Sherni, Narappa, Sarpatta Parambarai, Kuruthi, Joji, Malik, and HOME, along with Indian-produced Amazon Original series like Farzi, Jubilee, Dahaad, The Family Man, Mirzapur, Made in Heaven, Four More Shots Please!, Mumbai Diaries 26/11, Suzhal  The Vortex, Modern Love, Paatal Lok, Bandish Bandits, Guilty Minds, Cinema Marte Dum Tak, and Amazon Original movies like Maja Ma \u0026 Ammu. Also included are popular global Amazon Originals like Citadel, The Lord of The Rings: The Rings of Power, Reacher, Tom Clancy's Jack Ryan, The Boys, Hunters, Fleabag, The Marvelous Mrs. Maisel, \u0026 many more, available for unlimited streaming as part of a Prime membership. Prime Video includes content across Hindi, Marathi, Gujarati, Tamil, Telugu, Kannada, Malayalam, Punjabi, \u0026 Bengali. \nPrime Video Mobile Edition: Consumers can also enjoy Prime Videos exclusive content library with Prime Video Mobile Edition at 599 per year. This single-user, mobile-only annual video plan offers everyone access to high-quality entertainment exclusively on their mobile devices. Users can sign-up for this plan via the Prime Video app (on Android) or website. \nInstant Access: Prime Members can watch anywhere, anytime on the Prime Video app for smart TVs, mobile devices, Fire TV, Fire TV stick, Fire tablets, Apple TV, \u0026 multiple gaming devices. Prime Video is also available to consumers through Airtel and Vodafone pre-paid \u0026 post-paid subscription plans. In the Prime Video app, Prime members can download episodes on their mobile devices \u0026 tablets \u0026 watch anywhere offline at no additional cost.\nEnhanced experiences: Make the most of every viewing with 4K Ultra HD- \u0026 High Dynamic Range (HDR)-compatible content. Go behind the scenes of your favourite movies \u0026 TV shows with exclusive X-Ray access, powered by IMDb. Save it for later with select mobile downloads for offline viewing. \nVideo Entertainment Marketplace: In addition to a Prime Video subscription, customers can also purchase add-on subscriptions to other streaming services, as well as, get rental access to movies on Prime Video. Prime Video Channels: Prime Video Channels offers friction-free \u0026 convenient access to a wide range of premium content from multiple video streaming services all available at a single destination  Prime Video website \u0026 apps. Prime Members can buy add-on subscriptions \u0026 enjoy a hassle-free entertainment experience, simplified discovery, frictionless payments, \u0026 more. Rent: Consumers can enjoy even more movies from new releases to classic favourites, available to rent  no Prime membership required. View titles available by visitingprimevideo.com/store. The rental destination can be accessed via the STORE tab on primevideo.com \u0026 the Prime Video app on Android smart phones, smart-TVs, connected STBs, \u0026 Fire TV stick.","styleRuns":[{"startIndex":0,"length":3882,"styleRunExtensions":{"styleRunColorMapExtension":{"colorMap":[{"key":"USER_INTERFACE_THEME_DARK","value":4294967295},{"key":"USER_INTERFACE_THEME_LIGHT","value":4279440147}]}},"font Sunayana Kumari and Radhika Malhotra.\nProduced by Ashi Dua Sara and Karan Kapadia\nCreated by Nitya Mehra.\n\nOfficial Release Date March 14, 2024 on Prime Video India.\n\nAbout Prime Video: Prime Video is a premium streaming service that offers Prime members a collection of award-winning Amazon Original series, thousands of movies \u0026 TV showsall with the ease of finding what they love to watch in one place. Prime Video is just one of the many benefits of a Prime membership, available for just 1499/ year. \nIncluded with Prime Video: Thousands of acclaimed TV shows \u0026 movies across languages \u0026 geographies, including Indian films such as Shershaah, Soorarai Pottru, Sardar Udham, Gehraiyaan, Jai Bhim, Jalsa, Shakuntala Devi, Sherni, Narappa, Sarpatta Parambarai, Kuruthi, Joji, Malik, and HOME, along with Indian-produced Amazon Original series like Farzi, Jubilee, Dahaad, The Family Man, Mirzapur, Made in Heaven, Four More Shots Please!, Mumbai Diaries 26/11, Suzhal  The Vortex, Modern Love, Paatal Lok, Bandish Bandits, Guilty Minds, Cinema Marte Dum Tak, and Amazon Original movies like Maja Ma \u0026 Ammu. Also included are popular global Amazon Originals like Citadel, The Lord of The Rings: The Rings of Power, Reacher, Tom Clancy's Jack Ryan, The Boys, Hunters, Fleabag, The Marvelous Mrs. Maisel, \u0026 many more, available for unlimited streaming as part of a Prime membership. Prime Video includes content across Hindi, Marathi, Gujarati, Tamil, Telugu, Kannada, Malayalam, Punjabi, \u0026 Bengali. \nPrime Video Mobile Edition: Consumers can also enjoy Prime Videos exclusive content library with Prime Video Mobile Edition at 599 per year. This single-user, mobile-only annual video plan offers everyone access to high-quality entertainment exclusively on their mobile devices. Users can sign-up for this plan via the Prime Video app (on Android) or website. \nInstant Access: Prime Members can watch anywhere, anytime on the Prime Video app for smart TVs, mobile devices, Fire TV, Fire TV stick, Fire tablets, Apple TV, \u0026 multiple gaming devices. Prime Video is also available to consumers through Airtel and Vodafone pre-paid \u0026 post-paid subscription plans. In the Prime Video app, Prime members can download episodes on their mobile devices \u0026 tablets \u0026 watch anywhere offline at no additional cost.\nEnhanced experiences: Make the most of every viewing with 4K Ultra HD- \u0026 High Dynamic Range (HDR)-compatible content. Go behind the scenes of your favourite movies \u0026 TV shows with exclusive X-Ray access, powered by IMDb. Save it for later with select mobile downloads for offline viewing. \nVideo Entertainment Marketplace: In addition to a Prime Video subscription, customers can also purchase add-on subscriptions to other streaming services, as well as, get rental access to movies on Prime Video. Prime Video Channels: Prime Video Channels offers friction-free \u0026 convenient access to a wide range of premium content from multiple video streaming services all available at a single destination  Prime Video website \u0026 apps. Prime Members can buy add-on subscriptions \u0026 enjoy a hassle-free entertainment experience, simplified discovery, frictionless payments, \u0026 more. Rent: Consumers can enjoy even more movies from new releases to classic favourites, available to rent  no Prime membership required. View titles available by visitingprimevideo.com/store. The rental destination can be accessed via the STORE tab on primevideo.com \u0026 the Prime Video app on Android smart phones, smart-TVs, connected STBs, \u0026 Fire TV stick.","styleRuns":[{"startIndex":0,"length":3882,"styleRunExtensions":{"styleRunColorMapExtension":{"colorMap":[{"key":"USER_INTERFACE_THEME_DARK","value":4294967295},{"key":"USER_INTERFACE_THEME_LIGHT","value":4279440147}]}},"fontFamilyName":"Roboto"}]},"headerRuns":[{"startIndex":0,"length":3882,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"}]}},{"videoDescri
